const defaultState = {
	focused: false
};

export default (state = defaultState, action) => {
	if(action.type === 'search_focused') {
		return {
			focused: true
		}
	};

	if(aciton.type === 'search_blurred') {
		return {
			focused: false
		}
	};
	return state;
}
